const e=JSON.parse('{"key":"v-3b468bb2","path":"/note/framework/springboot/plugin/2306211023.html","title":"spring boot 工程 jar 包瘦身","lang":"zh-CN","frontmatter":{"isOriginal":true,"date":"2023-06-21T00:00:00.000Z","index":true,"order":2,"category":["SpringBoot"],"tag":["插件"]},"headers":[{"level":2,"title":"问题描述","slug":"问题描述","link":"#问题描述","children":[]},{"level":2,"title":"瘦身原理","slug":"瘦身原理","link":"#瘦身原理","children":[{"level":3,"title":"原理","slug":"原理","link":"#原理","children":[]},{"level":3,"title":"配置实现","slug":"配置实现","link":"#配置实现","children":[]},{"level":3,"title":"问题","slug":"问题","link":"#问题","children":[]}]}],"git":{"createdTime":1699349485000,"updatedTime":1699349485000,"contributors":[{"name":"yanggl","email":"2549597630@qq.com","commits":1}]},"readingTime":{"minutes":3.73,"words":1118},"filePathRelative":"note/framework/springboot/plugin/2306211023.md","localizedDate":"2023年6月21日","excerpt":"<h1> spring boot 工程 jar 包瘦身</h1>\\n<p>Spring Boot项目的pom.xml文件中一般都会带有spring-boot-maven-plugin插件，该插件的作用就是会将依赖的jar包全部打包进去。<br>\\n但是该文件包含了所有的依赖和资源文件，会导致打出来的包会比较大。</p>\\n<p>而如果我们使用一般的打包命令时</p>\\n<div class=\\"language-bash\\" data-ext=\\"sh\\"><pre class=\\"language-bash\\"><code>mvn clean package\\n</code></pre></div><p>不会把依赖的jar包也打进去，这样打出来的包就会很小。</p>\\n","copyright":{"author":"Yaien","license":"MIT"}}');export{e as data};
